options.rowCallback:
function(row, data, displayNum, displayIndex, dataIndex) {
var value=data[2]; $(row).css({'background-color':value == 1 ? "#E69F0066" : value == 2 ? "#56B4E966" : value == 3 ? "#009E7366" : null});
}

ajax.data:
function(d) {
d.search.caseInsensitive = true;
d.search.smart = true;
d.escape = false;
var encodeAmp = function(x) { x.value = x.value.replace(/&/g, "%26"); }
encodeAmp(d.search);
$.each(d.columns, function(i, v) {encodeAmp(v.search);});
}
